import React from "react";
import "../App.css";

const Contact = () => {
  return (
    <div className="rectangles ">
      <h3
        style={{
          textShadow:
            "0 0 2px #fff, 0 0 4px #fff, 0 0 6px #fff, 0 0 8px #fff, 0 0 10px #fff, 0 0 12px #fff, 0 0 14px #fff,0 0 16px #fff,  0 0 18px #fff",
        }}
      >
        CONTACT ME
      </h3>
      <div>
        <div className="box">
          <i class="bi bi-envelope-open-fill fa-3x"></i>
          <p>yahoo</p>
        </div>

        <div className="box">
          <i class="bi bi-telephone-inbound-fill fa-3x"></i>
          <p>03 </p>
        </div>

        <div className="box">
          <h5> Address</h5>
        </div>
      </div>
    </div>
  );
};

export default Contact;
